import MenuItem from "./MenuItem";

const TopMenu = props => {

  const { menuItems } = props;

  return (
    <div className="ml-10 flex items-baseline space-x-1">
      {
        menuItems.map((item) => (          
          <MenuItem item={item} subItems={item.subItems} key={item.name}/>
      ))}
    </div>    
  )
}

export default TopMenu
